import React from 'react'
import "../components_style/about.css"


const about = () => {
  return (
    <div className='container vh-100 about_body'>

       {/* card 1 */}
    <div class="card">
    <img src="9.jfif" class="cardimg" alt="img1"/>
    <div class="cardbody">
    <p class="cardtext">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    </div>
    </div>
    
    </div>
  )
}

export default about
